import React from 'react';
import { Nav, NavLink, Bars, NavMenu, NavBtn, NavBtnLink } from "./Navbar";
const Navbar = () =>{
    return(
    <>
        <Nav>
        <NavLink to="/">
            <h1> Logo </h1>
        </NavLink>
        <Bars/>
        <NavMenu>
            <NavLink to="/about" activeStyle>
                About
            </NavLink>

        </NavMenu>
        {/*<NavBtn>
            <NavBtnLink to="/signin">Sign in</NavBtnLink>
        </NavBtn>*/}
        </Nav>
    </>

    );

};

export default Navbar;
